"use strict";const e=React.createElement;class LikeButton extends React.Component{constructor(e){super(e),this.state={liked:!1}}render(){return this.state.liked?"You liked comment number "+this.props.commentId:e("button",{onClick:()=>this.setState({liked:!0})},"Like")}}document.querySelectorAll(".app").forEach((t=>{const n=parseInt(t.dataset.commentid,10);ReactDOM.render(e(LikeButton,{commentId:n}),t)}));